import axios from "axios";
import React from "react";
import Navbarmenu from "./Components/Header/Navbarmenu";

class Home extends React.Component {

    componentDidMount() {
        const  config = {
            headers: {
                Authorization: 'Bearer ' + localStorage.getItem('token')
            }
        };

        axios.get('user').then(
            res => {
                console.log(res);
            },
            err => {
                console.log(err)
            }
        )
    }

    render () {
        return (
            <>
                <Navbarmenu />
                <h1>Login Please</h1>
            </>
        )    
    }  
}

export default Home;
